import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  const screenshots = [];
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for a product "Add to Cart" button (first visible one)
    await page.waitForSelector('.add-to-cart:not([disabled])', { timeout: 5000 });

    // Rapid Cart Manipulation Stress Test
    // We'll add/remove items to/from the cart rapidly

    // Find all enabled "Add to Cart" buttons
    const addToCartButtons = await page.$$('.add-to-cart:not([disabled])');
    const addCount = Math.min(5, addToCartButtons.length);

    // Rapidly add 5 products to the cart (or as many as available)
    for (let i = 0; i < addCount; i++) {
      await addToCartButtons[i].click();
      // Wait for notification to appear and disappear
      await page.waitForSelector('.notification.success', { timeout: 2000 });
      await page.waitForSelector('.notification.success', { state: 'detached', timeout: 3000 });
    }

    // Screenshot after adding
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_add.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_add.png'));

    // Open cart (find .cart or .cart-count and click)
    // Try multiple selectors for robustness
    let cartSelector = '.cart';
    await page.waitForSelector(cartSelector, { timeout: 5000 });
    await page.click(cartSelector);

    // Wait for cart modal to appear
    await page.waitForSelector('#cartModal', { timeout: 5000 });
    await page.waitForSelector('#cartModal[style*="display: block"]', { timeout: 5000 });

    // Screenshot cart with items
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_open.png'));

    // Remove items rapidly: click all "Remove" buttons in the cart
    const removeButtons = await page.$$('#cartModal .remove-item');
    let removed = 0;
    for (let btn of removeButtons) {
      await btn.click();
      removed++;
      // Wait for notification to appear and disappear
      await page.waitForSelector('.notification.info', { timeout: 2000 });
      await page.waitForSelector('.notification.info', { state: 'detached', timeout: 3000 });
    }

    // Screenshot after removing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_after_remove.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_after_remove.png'));

    // Extract cart count from cart icon
    let cartCount = null;
    try {
      await page.waitForSelector('#cartCount', { timeout: 2000 });
      cartCount = await page.$eval('#cartCount', el => el.textContent.trim());
    } catch (e) {
      cartCount = null;
    }

    // Extract cart modal content (should be empty)
    let cartModalContent = '';
    try {
      cartModalContent = await page.$eval('#cartItems', el => el.innerText);
    } catch (e) {
      cartModalContent = '';
    }

    return {
      success: true,
      action: "Rapidly added and removed items from cart to stress-test cart manipulation. Verified cart is empty at end.",
      extractedData: {
        cartCount,
        cartModalContent
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots,
      error: error.message
    };
  }
}
